const getProducts = () => {
  return fetch('products.json')
    .then((response) => response.json())
    .then((products) => {
      console.log(products);
      return (products || []).map((product) => {
        return {

          id: product.code,
          name: product.name,
          price: product.price,
          sales_ranking: product.sales_ranking,
          size_stockS: product.size_stock.S,
          size_stockM: product.size_stock.M,
          size_stock: product.size_stock.L,
          stockout_rate: product.stockout_rate*100,
          wh_coverage: product.wh_coverage
        };

      });
    });
};

export default getProducts;
